        <footer>
            <div className="footer-in">
                <div className="footer-in-one">
                    <img src={Tree} className='FooterTree' alt="Tree Footer"/>

                </div>
                <div className="footer-in-two">

                </div>
                <div className="footer-in-three">

                </div>
            </div>
        </footer>
     );
}

export default Footer;
